#####
# Function
#   gen_test_md5s
#
# Purpose
#   Generate MD5 sums of gatekeeper created store
#   files by running 'md5sum' against the files 
#   contained in the given directory
# 
# Arguments
#   dir - directory containing gatekeeper store
#         files (*.gkpStore/)
#
# Return
#   success - NONE
#   failure - exit 1
#####
gen_test_md5s()
{
  local dir=$1

  if [ ! -d $dir ]; then
    echo "gen_test_MD5s: directory $dir does not exist";
    exit 1;
  fi

  pushd $dir > /dev/null 2>&1
  for file in $(ls -1 | grep -v "\.phash$")
  do
    patch_gkpStore_tfields $file
    $MD5_BIN $file >> $TEST_MD5S
  done
  for file in $(ls -1 | grep "\.phash$")
  do
    patch_gkpStore_phash $file
    $MD5_BIN $file >> $TEST_MD5S
  done
  popd > /dev/null 2>&1
}

cmp_md5s() 
{
  local gmd5_line=""
  local gmd5_file=""
  local tmd5_line=""
  local gmd5=""
  local tmd5=""
  local c=1
  
  for gmd5_line in "$(head -n $c $GOOD_MD5S | tail -1)"
  do
    gmd5=$(echo $gmd5_line | awk '{ print $1 }')
    
    gmd5_file=$(echo $gmd5_line | awk '{ print $NF }')
    tmd5_line=$(grep $gmd5_file $TEST_MD5S)
    ret=$?

    if [ "$ret" != "0" ]; then
      echo "Error: $gmd5_file not found in file $TEST_MD5S"
      FAILED        
    fi

    tmd5=$(echo $tmd5_line | awk '{ print $1 }')
    if [ "$tmd5" != "$gmd5" ]
    then
      echo -n "Error: test md5sum and baseline md5sum do "
      echo -n "not match for file $gmd5_line"
      FAILED 
    fi 

    c=$(( $c + 1 ))
  done
}

#####
# Function
#   RUN_TEST
#
# Purpose
#   Run the given gatekeeper binary against
#   the frag file within this script. Verify
#   that the results match the baseline results
#   by comparing MD5 checksums of the generated
#   gatekeeper store files
#
# Arguments
#   NONE
#
# Return
#   success - NONE
#   failure - exit 1
#####
RUN_TEST() {
  if [ ! -f $GKP_BIN ]; then
    echo "Err: $(pwd)/gatekeeper executable not found"
    FAILED
  fi

  if [ ! -f ${RUN_DIR}/$FRAG_FILE ]; then
    echo "Err: $(pwd)/${RUN_DIR}/$FRAG_FILE not found"
    FAILED
  fi

  pushd ${RUN_DIR} > /dev/null 2>&1

  ###
  # Clean up from any previous runs
  ###
  rm -rf ${FRAG_PREF}.gkpStore

  ###
  # Run gatekeeper against the frag file contained
  # within this script
  ###
  $GKP_BIN -X -C -N -Q -P -f \
    ${FRAG_PREF}.gkpStore ${FRAG_PREF}.frg > /dev/null 2>&1

  ret=$?
  if [ "$ret" -ne "0" ]; then
    echo "gkp_exec: $(pwd)/gatekeeper failed!"
    exit 1
  fi

  if [ ! -d ${FRAG_PREF}.gkpStore ]; then
    echo "gkp_exec: Frag store NOT created"
    exit 1
  fi
  
  ###
  # Generate the MD5s of the gatekeeper store
  # files we just created
  #
  # Then create the MD5s of the known good (baseline)
  # gatekeeper store files
  ###
  gen_test_md5s ${FRAG_PREF}.gkpStore
  gen_good_md5s

  ###
  # They should be the same since we are running
  # gatekeeper against the same input used to 
  # generate the baseline MD5s
  #
  # Test will abort within this function if the MD5 sums
  # do not match
  ###
  cmp_md5s

  popd > /dev/null 2>&1
}

